import React, { useEffect } from 'react';

const EducationalBackground = () => {
  useEffect(() => {
    if (window.AOS) {
      window.AOS.init();
    }
  }, []);

  const educationData = [
    {
      years: "2007-2009",
      school: "St. John Bosco Marikina",
      level: "Kinder and Pre-school",
    },
    {
      years: "2009-2015",
      school: "St. Scholastica Academy Marikina",
      level: "Grade 1 - Grade 6",
    },
    {
      years: "2015-2019",
      school: "Marikina Science High School",
      level: "Junior High School",
    },
    {
      years: "2019-2021",
      school: "St. Scholastica’s College",
      level: "Senior High School",
    },
    {
      years: "2021-Present",
      school: "Your University Name",
      level: "Bachelor’s Degree in Computer Science",
    },
  ];

  return (
    <section className="educational-container" id="education" data-aos="fade-up">
      <h2 className="educational-title">Educational Background</h2>
      <table className="educational-table">
        <tbody>
          {educationData.map((edu, index) => (
            <tr key={index}>
              <td className="educational-years">{edu.years}</td>
              <td>
                <div className="educational-school">{edu.school}</div>
                <div className="educational-level">{edu.level}</div>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </section>
  );
};

export default EducationalBackground;
